sys_variable_value.value:
(function execute(inputs, outputs) {
 var notify = new sn_notify.NotifyScoped();
 var from = '+12253963290';
 var to = inputs["to"];
 new notify.sendSMS(from, to, 'Hi '+ inputs["patientName"]+","+ '\n'+ 'Total Amount Requested for Insurance Claim is : '+ inputs["totalAmount"] + '\n'+ 'Your Request for Insurance Claim is InProgress'+'\n'+'Thank you.');
})(inputs, outputs);

